data = pd.read_csv('final_dataset.csv')

data.drop(columns=['Unnamed: 0','timestamp','date','year'],inplace=True)
data

"""### Splitting Data Into Train and Test Datasets"""

user_freq=data.groupby(['userId']).size().reset_index(name='counts')
users_lt3=user_freq[user_freq['counts']<3][['userId']]
users_ge3=user_freq[user_freq['counts']>=3][['userId']]
train1 = pd.merge(data, users_lt3, on=['userId'],how='inner')
data1 = pd.merge(data, users_ge3, on=['userId'],how='inner')
random.seed(2)
test=data1.groupby('userId').sample(frac=.3, random_state=2)
test_idx = data1.index.isin(test.index.to_list())
train = train1.append(data1[~test_idx])

train = train.reset_index().drop(columns=['index'])
test = test.reset_index().drop(columns=['index'])

"""### Pivoting the Train Dataset"""

train_df = train.pivot(index='userId', columns='movieId', values='rating')

# No. of Users
n1=train['userId'].nunique()

# No. of Movies
n2=train['movieId'].nunique()

users = train_df.index.values
movies = train_df.columns.values

train_df.columns=[i for i in range(n2)]
train_df.reset_index(inplace=True)
train_df = train_df.drop(columns=["userId"])

omega_user = {}
for i in range(0,len(train_df)):
    l = train_df.columns[np.isfinite(train_df.iloc[i])]
    omega_user[i] = list(l)
    
omega_movie={col: train_df[col].dropna().index for col in train_df}

training = train_df.to_numpy()
training_transpose = training.T

test_df = test.pivot(index='userId', columns='movieId', values='rating')
test_arr = test_df.to_numpy()
testing = test_arr[~np.isnan(test_arr)]

test_users=np.array(test['userId'])
test_movies=np.array(test['movieId'])
test_rating=np.array(test['rating'])

user = users.tolist()
movie = movies.tolist()

users

"""We keep the rank of factorized matrix as 10, mean is 0 and variance as 0.25 after some hyperparamter optimization"""

d = 10 
lmbda=1
cov = lmbda * np.identity(d)               
mean=[0]*d
var=0.25

ll=[]
random.seed(2)
v=np.random.multivariate_normal(mean,cov,n2)
random.seed(3)
u=np.random.multivariate_normal(mean,cov,n1)
for i in range(0,100):
  for j in range(0,n1):
    a=omega_user[j]

    new_v=v[a]

    m1 = training[j][~np.isnan(training[j])]

    u[j]=np.dot(inv(var*cov+np.dot(new_v.T,new_v)),np.dot(new_v.T,m1))
  
  for j in range(0,n2):
    b=omega_movie[j]

    new_u=u[b]
    m2 = training_transpose[j][~np.isnan(training_transpose[j])]

    v[j]=np.dot(inv(var*cov+np.dot(new_u.T,new_u)),np.dot(new_u.T,m2))

  if i>=1:
    loss=-(0.5/var)*np.nansum((training-np.dot(u,v.T))**2)-0.5*np.sum(u**2)-0.5*np.sum(v**2)
    ll.append(loss)

pred = []
predictions=np.dot(u,v.T)
for z in range(0,len(test)):
  pred.append(predictions[user.index(test_users[z])][movie.index(test_movies[z])])

rmse=np.mean((pred-test_rating)**2)**0.5
print("Run completed")

plt.figure()
plt.plot(ll)
plt.xlabel("Iterations")
plt.ylabel("Joint Log likelihood")
plt.show()

print('The Rmse on the baseline Probabilistic Matrix Factorization Model is', rmse)

"""The RMSE we attain for our baseline model is 0.983."""

pred_df = pd.DataFrame(predictions, columns = movies, index = users)
pred_df.reset_index(inplace=True)
pred_df.rename(columns={'index':'userId'},inplace=True)

preds_df = pd.melt(pred_df, 
            id_vars='userId', 
            value_vars=list(pred_df.columns[1:]), # list of days of the week
            var_name='movieId', value_name='predictions')
preds_df

df = pd.merge(preds_df,train,on=['userId','movieId'],how='left')
df = df[df['rating'].isnull()]

